import React from "react";
import "./Calendar.css";
export default class Header extends React.Component {
  render() {
    return (
      <div className="header_box">
        <div
          className="prevBtn"
          onClick={() => {
            this.props.moveMonth(-1);
          }}
        >
          이전
        </div>
        <div className="calendar_header">{this.props.calendarMonth}</div>
        <div
          className="nextBtn"
          onClick={() => {
            this.props.moveMonth(+1);
          }}
        >
          다음
        </div>
      </div>
    );
  }
}
